import React, { Component } from 'react';
import UploadReportPopUp from "../../components/uploadReportPopUp/uploadReportPopUp"

export default class ReportBoxBtns extends Component {
    constructor(props) {
        super(props);
    }
    setErrorReport(){}

    render() {
        return (
            <div className="reports__container">
                <button className="btn btn-bg btn-success" style={{float:"left"}} onClick={() => this.props.dowloadHistory()}>Comments</button>
                <UploadReportPopUp setUploading={setUploading.bind(this)} setErrorReport={setErrorReport.bind(this)}/>
            </div>
        );
    }
}
